/* eslint-disable jsx-a11y/anchor-is-valid */
import { useUser } from "./UserContext";
import { Link } from "react-router-dom";
import "./css/nav.css";

interface NavbarProps {
  loggedIn: boolean;
  onLoginClick: () => void;
  onSubmitClick: () => void;
}

function Navbar({ loggedIn, onLoginClick, onSubmitClick }: NavbarProps) {
  const { logout, user } = useUser();

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <Link className="nav-link" to="/" id="nav-all">
          Hack or Snooze
        </Link>
      </div>
      {loggedIn ? (
        <div className="main-nav-links">
          |
          <Link
            className="nav-link"
            to="/"
            id="nav-submit-story"
            onClick={onSubmitClick}
          >
            submit
          </Link>
          |
          <Link className="nav-link" to="/favorites" id="nav-favorites">
            favorites
          </Link>
          |
          <Link className="nav-link" to="/mystories" id="nav-my-stories">
            my stories
          </Link>
        </div>
      ) : null}
      <div className="nav-right">
        {loggedIn ? null : (
          <Link
            className="nav-link"
            to="#"
            id="nav-login"
            onClick={onLoginClick}
          >
            login/signup
          </Link>
        )}
        {loggedIn ? (
          <Link className="nav-link" to="#" id="nav-user-profile">
            {user.user.name}
          </Link>
        ) : null}
        {loggedIn ? (
          <Link id="nav-logout" className="nav" to="#" onClick={logout}>
            <small>(logout)</small>
          </Link>
        ) : null}
      </div>
    </nav>
  );
}

export default Navbar;
